con:config.script:
import com.eviware.soapui.support.XmlHolder

def addrequest = testRunner.testCase.testSuite.project.testSuites["Customer"].testCases["Customer"].testSteps["CustomerSave"].getPropertyValue("request")
log.info addrequest

def holder = new XmlHolder(addrequest)

//to set the value in the request
holder.setNodeValue("//*:customer/firstname","Puja")
holder.setNodeValue("//*:customer/lastname","Joshi")
def regionCode = holder.getNodeValue("//*:regionCode")
log.info "The current region code is $regionCode"

if(regionCode!="KA")
{
	log.info "You are not in Karnataka..so your id cannot be created"
	testRunner.gotoStepByName("GetAllCustomer")
}

else
{
	log.info "You are in KA, please proceed with Signup"
	def newxml = holder.getXml()

     testRunner.testCase.testSuite.project.testSuites["Customer"].testCases["Customer"].testSteps["CustomerSave"].setPropertyValue("request",newxml)

     def tc = testRunner.testCase.testSuite.project.testSuites["Customer"].testCases["Customer"]

     def runner = tc.run (null,false)
     log.info "number of test case executed are : " +runner.results.size();
     assert runner.results.size()==6;

}
